„ÇäÁâ© Áî∑Â•≥ÂÖºÁî® Ë∂Ö‰∫∫Ê∞ó „Ç¶„ÇµËÄ≥„ÉÄ„É≥„Çπ ÈüìÂõΩ „Ç≠„É£„ÉÉ„Éó „Éè„É≠„Ç¶„Ç£„É≥ ‰ªÆË£Ö „Ç≥„Çπ„Éó„É¨ ËÄ≥„Åå„Éë„Çø„Éë„Çø ÁôΩ</span></p>\n',4,'2021-12-31 19:23:37'),(16,'<h1><span style=\"font-family: Manrope;\">Map of Evolution Poster</span></h1>\n<ul>\n<li><span style=\"font-family: Manrope;\">33.0\" √ó 23.4\" (DIN A1)</span></li>\n<li><span style=\"font-family: Manrope;\">Heavy, high-quality paper, vibrant colors</span></li>\n<li><span style=\"font-family: Manrope;\">Frame not included</span></li>\n</ul>\n<p><span style=\"font-family: Manrope;\">This Map of Evolution will give you an overview of the diversity of life and will help you understand the relationships between organisms. Discover how you are related to a turtle and marvel at the fact that flight evolved four times independently in very distantly related animals.</span></p>\n',6,'2022-01-06 10:22:52'),(17,'<h1><span style=\"font-family: Manrope;\">World Map Poster</span></h1>\n<ul>\n<li><span style=\"font-family: Manrope;\">33.0\" √ó 23.4\"</span></li>\n<li><span style=\"font-family: Manrope;\">Heavy, high-quality paper, vibrant colors</span></li>\n<li><span style=\"font-family: Manrope;\"><strong>Frame not included</strong></span></li>\n</ul>\n<p><span style=\"font-family: Manrope;\">We heard from many teachers that they are using our infographic posters in class. So we asked what would help them the most and made an Education Edition, for teachers, students and everyone else! This World Map Poster gives you an overview of the world, its countries and its climate zones with some typical vegetation and animals.</span></p>\n<p><span style=\"font-family: Manrope;\"><ins>https://shop-us.kurzgesagt.org/products/world-map-poster</ins></span></p>\n',7,'2022-01-06 10:26:28'),(18,'<p><span style=\"font-family: Manrope;\"><ins>https://shop-us.kurzgesagt.org/collections/infographic-posters/products/evolution-poster</ins></span></p>\n',6,'2022-01-06 10:29:26'),(19,'<h1><span style=\"font-family: Manrope;\">Periodic Table Poster</span></h1>\n<ul>\n<li><span style=\"font-family: Manrope;\">33\" √ó 23.4\"</span></li>\n<li><span style=\"font-family: Manrope;\">Heavy, high-quality paper, vibrant colors</span></li>\n<li><span style=\"font-family: Manrope;\"><strong>Frame not included</strong></span></li>\n</ul>\n<p><span style=\"font-family: Manrope;\">This Periodic Table Poster gives you an overview of the elements, their most important features and their relationship to other elements. Each element features an illustration of an interesting and memorable application or natural occurrence to help you memorize them.</span></p>\n',8,'2022-01-06 10:33:17'),(20,'<p><span style=\"font-family: Manrope;\"><ins>https://shop-us.kurzgesagt.org/products/periodic-table-poster</ins></span></p>\n',8,'2022-01-06 10:34:04'),(21,'<h1><span style=\"font-family: Manrope;\">Starry Night Poster (Glow in the Dark) ‚ú®</span></h1>\n<ul>\n<li><span style=\"font-family: Manrope;\">18.0\" x 24.0\"</span></li>\n<li><span style=\"font-family: Manrope;\">High-quality paper, vibrant colors</span></li>\n<li><span style=\"font-family: Manrope;\">Printed with glow in the dark ink</span></li>\n<li><span style=\"font-family: Manrope;\">Frame not included</span></li>\n</ul>\n<p><span style=\"font-family: Manrope;\">Ready. Set. Glow. This poster will look great in any room because it features a truly beautiful illustration of nature and the stars ‚Äì and also because it will literally glow softly in the dark after exposure to UV light.</span></p>\n<p></p>\n<p><span style=\"font-family: Manrope;\"><ins>https://shop-us.kurzgesagt.org/collections/scenic-posters/products/starry-night-poster</ins></span></p>\n<p></p>\n',9,'2022-01-06 10:40:17'),(22,'<h1><span style=\"font-family: Manrope;\">The Night Sky Poster</span></h1>\n<ul>\n<li><span style=\"font-family: Manrope;\">33.0\" √ó 23.4\"</span></li>\n<li><span style=\"font-family: Manrope;\">High-quality paper</span></li>\n<li><span style=\"font-family: Manrope;\">Printed with shiny metallic foil</span></li>\n<li><span style=\"font-family: Manrope;\">Frame not included</span></li>\n</ul>\n<p><span style=\"font-family: Manrope;\">Bring a piece of the night sky into your home and learn all about the stars and their special significance for humanity. Stars have served as the foundation of calendars, the inspiration for epic tales and were even used to predict the future. Today we are still fascinated by them, as we discover more about them than ever before.</span></p>\n<p></p>\n<p><span style=\"font-family: Manrope;\"><ins>https://shop-us.kurzgesagt.org/collections/special-posters/products/the-night-sky-poster</ins></span></p>\n',10,'2022-01-06 10:43:34'),(23,'<h3 style=\"text-align:center;\"><span style=\"font-family: Manrope;\">Rick Astley Signed Never Gonna Give You Up Numbered Vinyl Record LP 7\" Single </span></h3>\n<p style=\"text-align:left;\"><span style=\"font-family: Jetbrains Mono;\">Size: </span><span style=\"color: rgb(255,255,255);background-color: rgba(145,158,171,0.08);font-size: 16px;font-family: Jetbrains Mono;\">7\"</span></p>\n<p><span style=\"font-family: Jetbrains Mono;\">Edition: </span><span style=\"color: rgb(255,255,255);background-color: rgba(145,158,171,0.08);font-size: 16px;font-family: Jetbrains Mono;\">2,500</span></p>\n<p><span style=\"font-family: Jetbrains Mono;\">Record: </span><span style=\"color: rgb(255,255,255);background-color: rgba(145,158,171,0.08);font-size: 16px;font-family: Jetbrains Mono;\">Blue</span></p>\n<p><span style=\"font-family: Jetbrains Mono;\">Year: </span><span style=\"color: rgb(255,255,255);background-color: rgba(145,158,171,0.08);font-size: 16px;font-family: Jetbrains Mono;\">2021</span></p>\n<p><span style=\"font-family: Jetbrains Mono;\">Markings: </span><span style=\"color: rgb(255,255,255);background-color: rgba(145,158,171,0.08);font-size: 16px;font-family: Jetbrains Mono;\">Signed, Numbered</span></p>\n<p><span style=\"font-family: Jetbrains Mono;\">Sleeve: </span><s